import os
import sys
import numpy as np
import cmath

from smuthi.particles import Sphere
from smuthi.simulation import Simulation
from smuthi.initial_field import DipoleSource
from smuthi.layers import LayerSystem


def is_same(val1, val2):
    assert cmath.isclose(val1, val2, rel_tol = 1e-7, abs_tol = 1e-18) 
    assert cmath.isclose(np.real(val1), np.real(val2), rel_tol = 1e-7, abs_tol = 1e-18) 
    assert cmath.isclose(np.imag(val1), np.imag(val2), rel_tol = 1e-7, abs_tol = 1e-18)


def simulation(lda = 416, l_max = 4, dimension = '2D'):
    
    # define characteristics of the incident wave (use dipole as extreme case)
    d = 50
    dipole_moment = [1, 1, 1]
    
    radius = 120
    thetas = np.linspace(0, 1.5*np.pi, num = 5, endpoint = False)
    rs = 2*np.sqrt(2)*radius*np.linspace(1, 4, num = 4, endpoint = True)
    particle_grid = [Sphere(position=[0,0,0],
                              refractive_index= 5+1j*0.5,
                              radius=radius,
                              l_max=l_max)]
    for idx,  r in enumerate(rs):
        for theta in thetas:
                x = r*np.cos(theta)
                y = r*np.sin(theta)
                if dimension == '2D':
                    z = 0
                else:
                    z = idx*r
                particle_grid.append(Sphere(position=[x, y, z],
                                          refractive_index= 5+1j*0.5,
                                          radius=radius,
                                          l_max= l_max+idx )) 
    
    layers = []
    layers = LayerSystem(thicknesses=[0, 0],refractive_indices=[1, 1])

    
    dipole_wave = []
    dipole_wave = DipoleSource(vacuum_wavelength=lda,
                                dipole_moment=dipole_moment,
                                position=[0, 0, (radius - d)])
    
    
    simulation = []
    simulation = Simulation(layer_system=layers,
                            particle_list=particle_grid,
                            initial_field=dipole_wave,
                            solver_type='LU',
                            store_coupling_matrix=True,
                            log_to_terminal=True,
                            check_circumscribing_spheres = True)
    
    simulation.run()
    
    coefficients = []
    for sphere in simulation.particle_list:
        coefficients.extend(sphere.scattered_field.coefficients)
    
